import React, { useState } from "react";
import axios from "axios";
import "./Form.css";

const CreateMember = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    category: "",
    level: "",
    ageGroup: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    await axios.post("http://127.0.0.1:8000/members/", formData);
    // response is assigned but not used
    // const response = await axios.post("http://127.0.0.1:8000/members/", formData);
    alert("Member created successfully!");
  };

  return (
    <div className="form-container">
      <h2>Create Member</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Name:</label>
          <input type="text" name="name" value={formData.name} onChange={handleChange} required />
        </div>
        <div className="form-group">
          <label>Email:</label>
          <input type="email" name="email" value={formData.email} onChange={handleChange} required />
        </div>
        <div className="form-group">
          <label>Category:</label>
          <input type="text" name="category" value={formData.category} onChange={handleChange} required />
        </div>
        <div className="form-group">
          <label>Level:</label>
          <input type="text" name="level" value={formData.level} onChange={handleChange} required />
        </div>
        <div className="form-group">
          <label>Age Group:</label>
          <input type="text" name="ageGroup" value={formData.ageGroup} onChange={handleChange} required />
        </div>
        <button type="submit">Create Member</button>
      </form>
    </div>
  );
};

export default CreateMember;
